      ( if  | val GHC.Classes.== "physical" -> Issuing'cardType'EnumPhysical
            | val GHC.Classes.== "virtual" -> Issuing'cardType'EnumVirtual
            | GHC.Base.otherwise -> Issuing'cardType'Other val
      )
